    "10000011": {
        "Name": "控制类负面状态",
        "Desc": "冻结，纠缠，禁锢，支配，怒噪，强烈震荡，异梦，缠禁，恐惧。"
    },
    "280150121": {
        "Name": "缠禁",
        "Desc": "行动延后，同时速度降低。下个回合开始时受到量子属性附加伤害。<br>【缠禁】状态下的目标每次受到攻击后，都会使该附加伤害提高，该效果最多叠加5层。该状态同时视为量子纠缠状态与禁锢状态。"
    },
